script: |
  super -f text -I q2108.spq | sort > q2108.out

inputs:
  - name: q2108.spq
    data: |
      SELECT DISTINCT - tab2.col1 / ( 74 * - tab2.col1 ) + + 17 * ( tab2.col0 ) AS col2 FROM tab2 (FORMAT parquet);
  - name: tab2

outputs:
  - name: q2108.out
    data: |
      119
      1326
      1343
